import React, {Component} from 'react';
import { StatusBar } from 'expo-status-bar';
import { createAppContainer } from 'react-navigation';
import { createStackNavigator } from 'react-navigation-stack';

import Register from './modules/login/containers/Register';
import Login from './modules/login/containers/Login';
import Home from './modules/home/containers/Home';

<StatusBar backgroundColor="blue" style="light" />  
const LoginNavigator = createStackNavigator({
    Login: {
        screen: Login,
        navigationOptions: {
            headerShown: false,
            title: 'prueba'
        }
    },
    Register: {
        screen: Register,
        navigationOptions: {
            headerShown: true,
            title: 'Volver',
            headerStyle: {
                backgroundColor: '#C7C8CE',
            }
        }
    },
    Home: {
        screen: Home,
        navigationOptions: {
            headerShown: true,
            title: 'prueba',
            headerBackImage: (
                <MyCustomHeaderBackImage style={styles.myCustomHeaderBackImageAlt} />
            ),
        },
        headerStyle: {
                backgroundColor: '#C7C8CE',
        }
    }
},
{
    contentComponent: props => <SideBar {...props} />
});
export default createAppContainer(LoginNavigator);  

const styles = StyleSheet.create({
  myCustomHeaderBackImage: {
    height: 14.5,
    width: 24,
    marginLeft: 9,
    marginRight: 12,
    marginVertical: 12,
    resizeMode: 'contain',
  },
  myCustomHeaderBackImageAlt: {
    tintColor: '#f00',
  },
});
